import { Link } from "react-router-dom";


import logo from "../assets/images/logo.svg";
import camera from "../assets/images/camera.svg";
import search from '../assets/images/search-plus-solid.svg'
import users from '../assets/images/user-plus-solid.svg'
import signup from '../assets/images/id-card-regular.svg'
import signin from '../assets/images/sign-in-alt-solid.svg'
import signout from '../assets/images/sign-out-alt-solid.svg'

export default function Header() {
  return (
    <header id="main-header">
      <div className="header-content">
        <Link to="/home">
          <img src={logo} alt="logo" />
        </Link>

        <Link to="/sign-up">
          {" "}
          <img src={signup} alt="signup" />
        </Link>

        <Link to="/sign-in">
        {" "}
        <img src={signin} alt="signin" />
      </Link><Link to="/add-users">
      {" "}
      <img src={users} alt="publish" />
    </Link>

        <Link to="/add-users">
          {" "}
          <img src={users} alt="publish" />
        </Link>

      <Link to="/new">
          {" "}
          <img src={camera} alt="publish" />
        </Link>
        <Link to="/search-hashtags">
          {" "}
          <img src={search} alt="publish" />
        </Link>
        <Link to="/profile">
          {" "}
          <img src={camera} alt="publish" />
        </Link>


      </div>

    </header>
  );
}
